import './App.css';
import { Routes, Route } from 'react-router-dom'
import LoginView from './views/LoginView';
import CreateAccountView from './views/CreateAccountView';
import { Dashboard } from './views/Dashboard';
import LifeExpectancyView from './views/LifeExpectancyView';
import MedicalView from './views/MedicalView';

function App() {
  return (
    <Routes>
      <Route path='/' element={<LoginView />} />
      <Route path='/createAccount' element={<CreateAccountView />} />
      <Route path='/DashBoard' element={<Dashboard />} />
      <Route path='/LifeExpectancy' element={<LifeExpectancyView />} />
      <Route path='/MedicalLookUp' element={<MedicalView />} />
    </Routes>
  );
}

export default App;
